    "2015-01-22T15:57:28.051344",nt"name": "census-data",nt"isopen": false,nt"url":
    null,nt"notes": "The Bureau of the Census has released Census 2000 Summary
    File 1 (SF1) 100-Percent data. The file includes the following population items:
    sex, age, race, Hispanic or Latino origin, household relationship, and household
    and family characteristics. Housing items include occupancy status and tenure (whether
    the unit is owner or renter occupied). SF1 does not include information on incomes,
    poverty status, overcrowded housing or age of housing. These topics will be covered
    in Summary File 3. Data are available for states, counties, county subdivisions,
    places, census tracts, block groups, and, where applicable, American Indian and
    Alaskan Native Areas and Hawaiian Home Lands. The SF1 data are available on the
    Bureau's web site and may be retrieved from American FactFinder as tables, lists,
    or maps. Users may also download a set of compressed ASCII files for each state
    via the Bureau's FTP server. There are over 8000 data items available for each geographic
    area. The full listing of these data items is available here as a downloadable compressed
    data base file named TABLES.ZIP. The uncompressed is in FoxPro data base file (dbf)
    format and may be imported to ACCESS, EXCEL, and other software formats. While all
    of this information is useful, the Office of Community Planning and Development
    has downloaded selected information for all states and areas and is making this
    information available on the CPD web pages. The tables and data items selected are
    those items used in the CDBG and HOME allocation formulas plus topics most pertinent
    to the Comprehensive Housing Affordability Strategy (CHAS), the Consolidated Plan,
    and similar overall economic and community development plans. The information is
    contained in five compressed (zipped) dbf tables for each state. When uncompressed
    the tables are ready for use with FoxPro and they can be imported into ACCESS, EXCEL,
    and other spreadsheet, GIS and database software. The data are at the block group
    summary level. The first two characters of the file name are the state abbreviation.
    The next two letters are BG for block group. Each record is labeled with the code
    and name of the city and county in which it is located so that the data can be summarized
    to higher-level geography. The last part of the file name describes the contents
    . The GEO file contains standard Census Bureau geographic identifiers for each block
    group, such as the metropolitan area code and congressional district code. The only
    data included in this table is total population and total housing units. POP1 and
    POP2 contain selected population variables and selected housing items are in the
    HU file. The MA05 table data is only for use by State CDBG grantees for the reporting
    of the racial composition of beneficiaries of Area Benefit activities. The complete
    package for a state consists of the dictionary file named TABLES, and the five data
    files for the state. The logical record number (LOGRECNO) links the records across
